import Reach from 'react'

const Student = ({ student }) => {
  return (
    <div key={student.id}>
    <p>Name: {student.name}</p>
    <p>Age: {student.age}</p>
    <p>Gender: {student.gender} </p>
  </div>
)
}

export default Student;
